import React from 'react';
import PropTypes from 'prop-types';
import styles from './FoodList.module.css';

class List extends React.Component{
    render(){
        return(
            <table className="table">
                <thead className="thead-dark">
                <tr>
                    <th scope="col">Název</th>
                    <th scope="col">Ingredience</th>
                    <th scope="col">Popis</th>
                </tr>
                </thead>
                <tbody>
                <tr>
                    <td>Mark</td>
                    <td>
                        <div className="ingredience-list">
                            <label className="ingredience btn-sm btn-info">Mléko</label>
                            <label className="ingredience btn-sm btn-info">Máslo</label>
                            <label className="ingredience btn-sm btn-info">Mouka</label>
                        </div>
                    </td>
                    <td>@mdo</td>
                </tr>
                </tbody>
            </table>
        );
    }
}
export default List;
